function RoutineCard({ routine }) {
  let totalDuration = 0;
  for (let i = 0; i < routine.length; i++){
    totalDuration = totalDuration + (routine[i].numbers * routine[i].duration)
  }
  console.log(totalDuration)

  return (
      <S.RoutineCard>
        루틴이름: 
        소요시간: {totalDuration}
        소모 칼로리: 
      </S.RoutineCard>
  )
}

export default RoutineCard;
